import Link from 'next/link';

const SideNav = () => {


  return (
    <div className="side-nav">
      <Link href='/shop'>
        <a className='side-nav__link' >SHOP</a>
      </Link>
      <Link href='/collections'>
        <a className='side-nav__link' >COLLECTIONS</a>
      </Link>
      <Link href='/shopInsta'>
        <a className='side-nav__link' >SHOP INSTA</a>
      </Link>
      <Link href='/blog'>
        <a className='side-nav__link' >BLOG</a>
      </Link>
      <Link href='/contact'>
        <a className='side-nav__link' >CONTACT US</a>
      </Link>
      <Link href='/'>
        <a className='side-nav__link' >HOME</a>
      </Link>
    </div>
  );
};

export default SideNav;
